<div id="experimental-design" class="section level2">
<h2> Raw Data</h2>
The raw data is <a href="data">here</a>
<h2>Experimental Design</h2>
<p>This experiment explores the effect of miR-210 Overexpression in MCF7 breast cancer cells (Human). 4 Lanes of mRNA-Seq data are used with 2 controls (overexpression of a <em>C.elegans</em> miR cel-mir-67) and 2 samples over-expressing miR-210.</p>
<p>This is the <em>pdata.txt</em> file:</p>
<table>
<thead>
<tr class="header">
<th align="left"><em>SampleName</em></th>
<th align="left"><em>fileName</em></th>
<th align="left"><em>condition</em></th>
</tr>
</thead>
<tbody>
<tr class="odd">
<td align="left">m210_1</td>
<td align="left">hisat.merged_1_16.fq.27197.bam.counts.merged</td>
<td align="left">mir210</td>
</tr>
<tr class="even">
<td align="left">m210_2</td>
<td align="left">hisat.merged_1_24.fq.27197.bam.counts.merged</td>
<td align="left">mir210</td>
</tr>
<tr class="odd">
<td align="left">cont_1</td>
<td align="left">hisat.merged_1_32.fq.27197.bam.counts.merged</td>
<td align="left">ctrl</td>
</tr>
<tr class="even">
<td align="left">cont_2</td>
<td align="left">hisat.merged_1_40.fq.27197.bam.counts.merged</td>
<td align="left">ctrl</td>
</tr>
</tbody>
</table>
<p>First we will load required modules and change to our working directory</p>
<pre class="r"><code>library(&quot;DESeq2&quot;)
library(&quot;gplots&quot;)
library(&quot;RColorBrewer&quot;)

setwd(&quot;~/Desktop/wtac_mrna_2016&quot;)</code></pre>
<p>Let’s make a colour palette (100 colours) for nice heatmaps (Green to Blue)</p>
<pre class="r"><code>hmcol = colorRampPalette(brewer.pal(9, &quot;GnBu&quot;))(100)</code></pre>
</div>
<div id="reading-in-annotation-and-count-data" class="section level2">
<h2>Reading in Annotation and Count Data</h2>
<p>We’ll now read in the experimental design file (<em>pdata.txt</em>) and the a containing gene names (<em>gene_names.txt</em>).</p>
<p>We will also create a vector containing condition names for each sample.</p>
<p>Finally, we will make a vector of colours that correspond to each condition for nicer plots later on. We’ll also make colours corresponding to each class (<em>biotype</em>) of gene.</p>
<pre class="r"><code>pdata=read.table(&quot;pdata.txt&quot;,header=TRUE)

conds=as.vector(pdata$condition) 
names=read.table(&quot;gene_names.txt&quot;,header=FALSE,row.names=1)

condcols=brewer.pal(n = length(unique(conds))+2, name = &quot;Dark2&quot;)
names(condcols)=unique(conds)

typecols=rainbow(44)[names$V4]
names(typecols)=rownames(names)</code></pre>
<p>Next we’ll read in the actual raw counts derived from HTSeq.</p>
<p>The DESeq2 function has an option <em>DESeqDataSetFromHTSeqCount</em> that reads in counts from HTSeq output files. We just need to provide it with a directory and an appopropriate <em>pdata.txt</em> file.</p>
<pre class="r"><code>ddsHTSeq &lt;- DESeqDataSetFromHTSeqCount(sampleTable = pdata, directory = &quot;.&quot;, design= ~ condition)

# Restrict to protein coding and lincRNA ?
#ddsHTSeq=ddsHTSeq[(names[rownames(ddsHTSeq),&quot;V4&quot;] == &quot;protein_coding&quot;) | (names[rownames(ddsHTSeq),&quot;V4&quot;] == &quot;lincRNA&quot;),]

colData(ddsHTSeq)$condition &lt;- factor(colData(ddsHTSeq)$condition,levels=levels(pdata$condition))</code></pre>
</div>
<div id="data-normalisation" class="section level2">
<h2>Data Normalisation</h2>
<pre class="r"><code># Data Normalisation
dds &lt;- estimateSizeFactors(ddsHTSeq)
# Data Dispersion
dds &lt;- estimateDispersions(dds)
# New Neg. Binomial test
dds &lt;- nbinomWaldTest(dds)

counts_table=counts(dds,normalized=TRUE)</code></pre>
<p>Let’s look at the DESeq2 Dispersion plot to see how it looks.</p>
<pre class="r"><code>X11()
plotDispEsts(dds,main=&quot;Dispersion Plot&quot;)</code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
</div>
<div id="post-normalisation-qc" class="section level2">
<h2>Post-Normalisation QC</h2>
<pre class="r"><code>X11()
par(mfrow=c(3,1))
barplot(colSums(counts(dds, normalized=F)), col=condcols[as.factor(conds)], las=2,cex.names=0.4,main=&quot;Pre Normalised Counts&quot;)
plot(1, type=&quot;n&quot;, axes=F, xlab=&quot;&quot;, ylab=&quot;&quot;)
legend(&quot;center&quot;,levels(as.factor(conds)),fill=condcols)
barplot(colSums(counts(dds, normalized=T)), col=condcols[as.factor(conds)], las=2,cex.names=0.4,main=&quot;Post Normalised Counts&quot;)</code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
<div id="stabilising-the-variance-vst-instead-of-log2" class="section level3">
<h3>Stabilising the Variance (VST) instead of log2</h3>
<p>Regularised log transformation and variance stabilising transformation, these function are usesful to visualise the data. See the DESeq2 manual for more information.</p>
<pre class="r"><code>vsd &lt;- varianceStabilizingTransformation(dds)
vstMat &lt;- assay(vsd)
counts_table=data.frame(counts_table,vstMat)</code></pre>
</div>
<div id="sample-to-sample-correlation" class="section level3">
<h3>Sample to Sample Correlation</h3>
<pre class="r"><code>X11()
heatmap.2(cor(assay(vsd)),trace=&quot;none&quot;,main=&quot;Sample Correlation Variance Stabilised&quot;,col=hmcol,cexRow=0.6,cexCol=0.6)</code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
</div>
<div id="sample-to-sample-pca" class="section level3">
<h3>Sample to Sample PCA</h3>
<pre class="r"><code># Sample PCA
X11()
pca &lt;- princomp(assay(vsd))
plot(pca$loadings, main=&quot;PCA Variance Stabilised&quot;, col=&quot;black&quot;, bg=condcols[pdata$condition],  pch=21, cex=1)
text(pca$loadings, conds, pos=3, cex=0.8)</code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
</div>
</div>
<div id="statistical-analysis" class="section level2">
<h2>Statistical Analysis</h2>
<p>Now we will perform the statistical tests.</p>
<ol style="list-style-type: decimal">
<li>Control vs miR-210 Overexpression</li>
</ol>
<p>For the test we are looking for how many genes are significantly changed with an Absolute Log Fold Change of at least 1 and an Adjusted P-Value of less than 0.05.</p>
<p>Lets see how many genes we find.</p>
<pre class="r"><code>res &lt;- results(dds, contrast=c(&quot;condition&quot;,&quot;ctrl&quot;,&quot;mir210&quot;))
res=res[order(res$padj),]

res</code></pre>
<pre><code>## log2 fold change (MAP): condition ctrl vs mir210 
## Wald test p-value: condition ctrl vs mir210 
## DataFrame with 60504 rows and 6 columns
##                  baseMean log2FoldChange     lfcSE       stat       pvalue
##                 &lt;numeric&gt;      &lt;numeric&gt; &lt;numeric&gt;  &lt;numeric&gt;    &lt;numeric&gt;
## ENSG00000163637  1649.288      1.3099039 0.1762526   7.431971 1.069916e-13
## ENSG00000143376  8882.666      1.0525812 0.1501076   7.012176 2.346392e-12
## ENSG00000112308 19819.711      0.9721699 0.1426358   6.815751 9.377247e-12
## ENSG00000151892  5132.390      1.0292913 0.1514075   6.798155 1.059674e-11
## ENSG00000107951  3626.723      1.1852511 0.1753440   6.759575 1.383969e-11
## ...                   ...            ...       ...        ...          ...
## ENSG00000283117 0.0000000             NA        NA         NA           NA
## ENSG00000283118 0.0000000             NA        NA         NA           NA
## ENSG00000283122 0.2762513    -0.06722627 0.1249756 -0.5379154    0.5906355
## ENSG00000283123 0.0000000             NA        NA         NA           NA
## ENSG00000283125 0.0000000             NA        NA         NA           NA
##                         padj
##                    &lt;numeric&gt;
## ENSG00000163637 4.492575e-10
## ENSG00000143376 4.926249e-09
## ENSG00000112308 1.112393e-08
## ENSG00000151892 1.112393e-08
## ENSG00000107951 1.162257e-08
## ...                      ...
## ENSG00000283117           NA
## ENSG00000283118           NA
## ENSG00000283122           NA
## ENSG00000283123           NA
## ENSG00000283125           NA</code></pre>
<pre class="r"><code>hits=(rownames(res[((res$padj &lt;= 0.05) &amp; (abs(res$log2FoldChange) &gt;= 1) &amp; (!is.na(res$padj))),]))</code></pre>
</div>
<div id="analysis-of-sample-median-data" class="section level2">
<h2>Analysis of Sample Median Data</h2>
<p>Sometimes it is useful to compute the median of each sample so we can make some different plots (e.g. pairwise plots).</p>
<pre class="r"><code>ctr_median=apply(vstMat[,3:4],1,median)
m210_median=apply(vstMat[,1:2],1,median)

X11()
plot(ctr_median,m210_median,pch=19,main=paste(&quot;ctrl vs m210&quot;),col=&quot;darkblue&quot;,cex=0.4)
points(ctr_median[hits],m210_median[hits],pch=19,col=typecols[hits],cex=0.4)
text(ctr_median[hits],m210_median[hits],cex=0.4,pos=4,labels=names[hits,&quot;V2&quot;])
abline(a=0,b=1,lty=2,col=&quot;red&quot;,lwd=2,cex=0.4)</code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
<pre class="r"><code>X11()
plot(ctr_median,m210_median,pch=19,main=paste(&quot;ctrl vs m210 Biotype&quot;),col=&quot;darkblue&quot;,cex=0.4)
points(ctr_median[hits],m210_median[hits],pch=19,col=typecols[hits],cex=0.4)
points(ctr_median,m210_median,pch=19,col=typecols,cex=0.2)
text(ctr_median[hits],m210_median[hits],cex=0.4,pos=4,labels=names[hits,&quot;V2&quot;])
abline(a=0,b=1,lty=2,col=&quot;red&quot;,lwd=2,cex=0.4)
legend(&quot;topleft&quot;,levels(unique(names$V4)),cex=0.4,bty=&quot;n&quot;,fill=rainbow(44))</code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
</div>
<div id="post-statistical-qc" class="section level2">
<h2>Post-Statistical QC</h2>
<p>Now we will construct a Volcano Plot to highlight each gene’s Significance versus its Fold Change. Genes which do not change much usually have poor P-Values so the plot has low significance around zero and hence looks like a <em>volcano</em>. Some genes may have high fold changes but poor significance, in these cases, usually the foldchanges observed do not replicate well from sample to sample.</p>
<div id="volcano-plot-of-significance-and-fold-change" class="section level3">
<h3>Volcano Plot of Significance and Fold Change</h3>
<pre class="r"><code>X11()
plot(res$log2FoldChange,-log(res$padj,10),ylab=&quot;-log10(Adjusted P)&quot;,xlab=&quot;Log2 FoldChange&quot;,main=paste(&quot;Volcano Plot Ctrl v miR210_oe&quot;),pch=19,cex=0.2)      
text(res[hits,]$log2FoldChange,-log(res[hits,]$padj,10),labels=names[rownames(res[hits,]),&quot;V2&quot;],pos=3,cex=0.4)
points(res[hits,&quot;log2FoldChange&quot;],-log(res[hits,&quot;padj&quot;],10),pch=19,cex=0.4,col=typecols[hits])
legend(&quot;topleft&quot;,&quot;Up in 210\nDown in Ctrl&quot;,cex=0.5)
legend(&quot;topright&quot;,&quot;Down in 210\nUp in Ctrl&quot;,cex=0.5)
abline(h=-log10(0.05),lty=3)
abline(v=-1,lty=3)
abline(v=1,lty=3)     </code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
</div>
<div id="heatmap-of-signficant-hits" class="section level3">
<h3>Heatmap of Signficant Hits</h3>
<p>We now compute a heatmap of the most significant hits.</p>
<pre class="r"><code>heatmap.2(vstMat[hits,],trace=&quot;none&quot;,col=hmcol,labRow=names[hits,&quot;V2&quot;],cexRow=0.4,cexCol=0.6,las=2,Colv=FALSE,dendrogram=&quot;row&quot;,main=&quot;Heatmap Sig. Hits&quot;,RowSideColors = typecols[hits])</code></pre>
<p><img src="data:image/png;base64," width="672" /></p>
</div>
</div>
<div id="output-final-results" class="section level2">
<h2>Output Final Results</h2>
<p>Let’s write the results out to a txt table file called <strong>FullCountsandStats.txt</strong>*</p>
<pre class="r"><code>fullresults=merge(names,counts_table,by.x=0,by.y=0)
fullresults=merge(fullresults,as.matrix(res),by.x=1,by.y=0)
fullresults=fullresults[order(fullresults$log2FoldChange,decreasing=T),]
fullresults=fullresults[!is.na(fullresults$log2FoldChange),]
rownames(fullresults)=fullresults$Row.names

write.table(fullresults,&quot;FullCountsandStats.txt&quot;,sep=&quot;\t&quot;,quote=F)</code></pre>
</div>




